componentsModule.modules.perex={start:function(){let current=componentsModule.modules.perex;current.parentElement=document.querySelector("[data-component=perex]");current.dateInput=current.parentElement.querySelector("[name=component_perex_date]");current.locationInput=current.parentElement.querySelector("[name=component_perex_location]");componentsModule.initializeEvent({event:"click",element:current.parentElement.querySelector(".clear-perex-date"),content:function(){current.dateInput.value=""}})},resume:function(){let current=componentsModule.modules.perex;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b);current.dateInput.value=a.perex_date;current.locationInput.value=a.perex_location;triggerEvent(current.locationInput,"change")},validate:function(){const a=componentsModule.modules.perex.serialize().perex_location;return(a.length<121)},serialize:function(){let current=componentsModule.modules.perex;return{perex_date:current.dateInput.value.trim(),perex_location:current.locationInput.value.trim()}}};